(1, 'Empresa', 'empresa', 1, 1, '<h3>Reseña Histórica</h3>\r\n<p><span class="input-block-level">Corporación Asociados Estaciones de Servicio de Colombia - AES Colombia,&nbsp;organización gremial conformada por empresas del sector de Distribuidores&nbsp;Minoristas de Combustibles, que desde hace más de cincuenta años venía&nbsp;funcionando en los Departamentos de Antioquia y Chocó, con otros nombres, siendo el último Fendipetróleo Antioquia Chocó.&nbsp;</span> <br />Hoy tenemos una nueva imagen gremial, una nueva generación que&nbsp;mantiene los principios que han unido al sector minorista distribuidor de<br />combustibles, pero ahora a nivel nacional&nbsp;</p>\r\n<h3>Propósito Institucional&nbsp;</h3>\r\n<p>Defender los intereses comunes de los distribuidores minoristas de<br />combustibles y energéticos de Colombia afiliados a la Corporación <br />AES Colombia.</p>\r\n<h3>Valores Corporativos</h3>\r\n<h4>Asociatividad</h4>\r\n<ul>\r\n<li>Trabajamos para desarrollar la cultura de pensar primero en el bien común de los afiliados,&nbsp;antes que en el bien particular.&nbsp;</li>\r\n<li>Estamos permanentemente dispuestos al cambio para aprender de otras personas y experiencias, celebrando alianzas&nbsp;estratégicas con aquellas personas e instituciones que se identifiquen con los fines y propósitos de AES Colombia.&nbsp;</li>\r\n<li>Somos éticos y actuamos con transparencia para construir la confianza de nuestros asociados .&nbsp;</li>\r\n<li>Somos considerados con nuestros asociados, nos solidarizamos con sus preocupaciones y los apoyamos en la búsqueda&nbsp;de las soluciones.&nbsp;</li>\r\n</ul>\r\n<h4>Excelencia</h4>\r\n<ul>\r\n<li>Buscamos con pasión ser competentes.</li>\r\n<li>Priorizamos el trabajo en equipo y aplicamos las mejores prácticas en todas nuestras actividades.</li>\r\n<li>Fomentamos la disciplina para desarrollar la cultura de mejoramiento permanente.</li>\r\n<li>Impulsamos el trabajo con responsabilidad social, empresarial y ambiental.</li>\r\n</ul>\r\n<h4>Servicio</h4>\r\n<ul>\r\n<li>Reconocemos nuestra gente como base del servicio que prestamos en la Corporación AES, apoyándonos en&nbsp;preceptos de respeto, trabajo en equipo y equidad.&nbsp;</li>\r\n<li>Somos cálidos, tratamos siempre con consideración e igualdad a todos nuestros asociados, sin discriminaciones ni arrogancia.&nbsp;</li>\r\n<li>Somos coherentes en lo que pensamos, decimos y actuamos.</li>\r\n<li>El servicio debe ser un hábito en cada uno de los colaboradores de AES Colombia.</li>\r\n</ul>\r\n<h3>Misión</h3>\r\n<p>Somos una Corporación que asocia distribuidores MINORISTAS de combustibles&nbsp;y energéticos que ejercen su actividad a través de las estaciones de servicio en&nbsp;Colombia.</p>\r\n<p>Trabajamos con energía, llevando la vocería y representación de los corporados&nbsp;y buscamos soluciones innovadoras a las necesidades que surgen en el manejo&nbsp;diario de sus estaciones de servicio, con base en la experiencia, preparación&nbsp;permanente y dedicación de nuestro equipo de trabajo altamente calificado. <br /> Desarrollamos nuestro trabajo fundamentados en la Asociatividad, la&nbsp;Excelencia en lo que emprendamos y un Servicio profesional, considerado, agradable y comprometido.</p>\r\n<h3>Visión</h3>\r\n<p>En el 2018 AES Colombia será una corporación líder que agrupa a&nbsp;los distribuidores minoristas de combustibles y energéticos en el&nbsp;país, por su representatividad, reconocimiento nacional y generación de confianza.</p>\r\n<p>Conseguiremos esto a través de:</p>\r\n<ol>\r\n<li>Brindar a nuestros afiliados servicios de alta calidad que la conviertan en su mejor opción.</li>\r\n<li>Mantener una cuota representativa de corporados dentro del mercado de la distribución minorista&nbsp;producto de su confianza por la transparencia y la representatividad de nuestras acciones</li>\r\n<li>Construir un ambiente laboral con apertura al cambio y trabajo en equipo agradable .</li>\r\n<li>Mantener una comunicación abierta y permanente con los diferentes públicos de interés&nbsp;</li>\r\n<li>Desarrollar el potencial humano para lograr un grupo de colaboradores capacitado, motivado y con&nbsp;una vocación de servicio de altísimo nivel.&nbsp;</li>\r\n<li>Implementar una Estructura Interna para analizar los temas que impactan a los afiliados y expresar&nbsp;su voz en defensa de sus legítimos intereses.&nbsp;</li>\r\n<li>Generar recursos frescos, y con su manejo transparente buscar la autonomía financiera y una&nbsp;mayor capacidad de prestación de mejores servicios&nbsp;</li>\r\n<li>Trabajar por el desarrollo del valor de la asociatividad.</li>\r\n</ol>', '', NULL, NULL, '[]', '', '2013-11-05 14:47:16', 486, '', 0, '0000-00-00 00:00:00', '2013-12-04 22:27:39', 486, '2013-11-05 14:47:16', '0000-00-00 00:00:00', 0, 1, 1, 0, 0, '', '', '', '', 117, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAudioHeight":"","itemVid