(8, 'Comunicaciones y Seguridad', 'comunicaciones-y-seguridad', 6, 1, '<ul>\r\n<li>Enlaces con la fuerza pública: realizar acompañamiento al afiliado en materia de seguridad y direccionarlos, según su caso, al área de las autoridades que corresponda (Policía Uniformada, SIJIN, Gaula).</li>\r\n<li>Asesoría en la implementación de estrategias en prevención del delito, en alianza con entidades como Incocredito, Policía Nacional, Gaula, Big Pass y Sodexo.&nbsp;</li>\r\n<li>Envío constante de información sobre temas de interés a través de artículos en coleccionables, Boletín Informativo, información noticiosa del sector en la página del facebook y twitter.&nbsp;</li>\r\n<li>Asesoría en manejo de Comunicación Interna y Externa y Relaciones&nbsp;Públicas.&nbsp;</li>\r\n<li>Asesoría en el correcto diligenciamiento del Sistema de Información&nbsp;de Combustibles SICOM y envío de documentos.</li>\r\n<li>Actualización de datos de las EDS</li>\r\n</ul>', '', NULL, NULL, '[]', '', '2013-11-07 19:47:27', 486, '', 486, '2013-11-25 21:22:41', '2013-11-25 21:22:29', 486, '2013-11-07 19:47:27', '0000-00-00 00:00:00', 0, 1, 1, 0, 0, '', '', '', '', 2, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","i