(10, 'Gestión Ambiental', 'gestion-ambiental', 6, 1, '<ul>\r\n<li>Elaboración de Planes de Manejo Ambiental.</li>\r\n<li>Caracterización ARD (Aguas Residuales Domésticas) y ARI (Aguas Residuales Industriales).</li>\r\n<li>Visitas de seguimiento ambiental y auditoría interna ambiental.</li>\r\n<li>Asesoría e implementación del PMIRS (Plan de Manejo Integral de Residuos Sólidos).</li>\r\n<li>Asesoría en trámites ambientales.</li>\r\n<li>Capacitaciones ambientales.</li>\r\n<li>Elaboración del Programa de Uso Eficiente y Racional del Agua “Pueyra”.</li>\r\n<li>Acompañamiento en la recolección de residuos peligrosos y reciclables.</li>\r\n</ul>', '', NULL, NULL, '[]', '', '2013-11-07 19:48:01', 486, '', 0, '0000-00-00 00:00:00', '2013-11-25 19:46:33', 486, '2013-11-07 19:48:01', '0000-00-00 00:00:00', 0, 1, 3, 0, 0, '', '', '', '', 1, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAud