(18, 'Secretaría', 'secretaria', 6, 1, '<ul>\r\n<li>Trámite de la Póliza de Responsabilidad Civil Extracontractual para EDS y para carrotanques.</li>\r\n<li>Solicitud o renovación del CCITE. (Certificado de Carencia por Informe del Certificado de Estupefacientes ante el Ministerio de Justicia.</li>\r\n<li>Asistencia a requisitos del CCITE y atención de vehículos por elradicado del CCITE.</li>\r\n<li>Envío de informes semestrales por compra y venta de combustibles a la subdirección de control y fiscalización de sustancias químicas yestupefacientes del Ministerio de Justicia.&nbsp;</li>\r\n<li>Convenio Plan Corporativo Claro.</li>\r\n</ul>', '', NULL, NULL, '[]', '', '2013-11-25 14:20:33', 486, '', 0, '0000-00-00 00:00:00', '2013-11-25 19:48:15', 486, '2013-11-25 14:20:33', '0000-00-00 00:00:00', 0, 1, 5, 0, 0, '', '', '', '', 0, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAudio