(19, 'Contable y Administrativo', 'contable-y-administrativo', 6, 1, '<ul>\r\n<li>Asesoría en presentación de declaraciones tributarias ante la DIAN y entes municipales, departamentales y nacionales.&nbsp;</li>\r\n<li>Asesoría en respuestas de requerimientos tributarios ante los&nbsp;diferentes entes de orden nacional, departamental y municipal.&nbsp;</li>\r\n<li>Trámite del Certificado de Ubicación en vías nacionales ante el Ministerio de Transporte.</li>\r\n<li>Asesoría en el diligenciamiento y presentación de Medios Magnéticos.</li>\r\n<li>Actualización en normatividad tributaria, contable e hidrocarburos.</li>\r\n<li>Asesoría en trámites para la certificación de las EDS.</li>\r\n<li>Revisión de liquidaciones laborales.</li>\r\n<li>Solicitud y renovación del CCITE (Certificado de Carencia Informe de&nbsp;Tráfico de Estupefacientes).</li>\r\n<li>Asesoría en el diligenciamiento del Libro Control de Estupefacientes.</li>\r\n</ul>', '', NULL, NULL, '[]', '', '2013-11-25 14:22:23', 486, '', 0, '0000-00-00 00:00:00', '2013-11-25 21:19:03', 486, '2013-11-25 14:22:23', '0000-00-00 00:00:00', 0, 1, 6, 0, 0, '', '', '', '', 0, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainC