(22, 'Nuestra Historia', 'nuestra-historia', 1, 1, '<h3 style="text-align: center;">Reseña Histórica</h3>\r\n<p><span class="input-block-level">Corporación Asociados Estaciones de Servicio de Colombia - AES Colombia,&nbsp;organización gremial conformada por empresas del sector de <a id="_GPLITA_0" title="Click to Continue &gt; by saveshare" href="empresa">Distribuidores<img src="http://cdncache-a.akamaihd.net/items/it/img/arrow-10x10.png" alt="" /></a>&nbsp;Minoristas de Combustibles, que desde hace más de cincuenta años venía&nbsp;funcionando en los Departamentos de Antioquia y Chocó, con otros nombres, siendo el último Fendipetróleo Antioquia Chocó.&nbsp;</span> <br />Hoy tenemos una nueva imagen gremial, una nueva generación que&nbsp;mantiene los principios que han unido al sector minorista distribuidor de<br />combustibles, pero ahora a nivel nacional</p>', '', NULL, NULL, '[]', '', '2013-12-04 22:27:43', 486, '', 0, '0000-00-00 00:00:00', '2013-12-04 22:29:35', 486, '2013-12-04 22:27:43', '0000-00-00 00:00:00', 0, 1, 5, 0, 0, '', '', '', '', 1, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAudioHeight":"","itemVideoAutoPlay":"","itemVideoCaption":"","itemVideoCredits":"","itemImageGallery":"","itemNavigation":"","itemComments":"","itemTwitterButton":"","itemFacebookButton":"","itemGooglePlusOneButton":"","itemAuthorBlock":"","itemAuthorImage":"","itemAuthorDescription":"","itemAuthorURL":"","itemAuthorEmail":"","itemAuthorLatest":"","itemAuthorLatestLimit":"","itemRelated":"","itemRelatedLimit":"","itemRelatedTitle":"","itemRelatedCategory":"","itemRelatedImageSize":"","itemRelatedIntrotext":"","itemRelatedFulltext":"","itemRelatedAuthor":"","itemRelatedMedia":"","itemRelatedImageGallery":"","itemK2Plugins":""}', '', 'robots=\nauthor=', '', '', '*'),
(23, 'Trabaje con nosotros', 'trabaja-con-nosotros', 1, 1, '<p>Contar con un personal de excelencia tiene un gran valor estratégico para nuestra compañía.</p>\r\n<p>Queremos potenciar a nuestros trabajadores, para lo que proveemos de un lugar de trabajo seguro y saludable, en el que imperan a cabalidad las normas legales e industriales del país, la ética empresarial y una cultura en la que los reconocimientos están asociados a desempeños objetivos y no a otras consideraciones.</p>\r\n<p>Nuestra tasa de sindicalización llega a 98%, lo que ha permitido establecer una sólida relación entre la administración y los trabajadores, organizados en los 10 sindicatos existentes.</p>\r\n<p>&nbsp;</p>\r\n<h2>Gestión de Talentos</h2>\r\n<p>Para atraer, retener y ofrecer oportunidades de desarrollo laboral a los profesionales y trabajadores mejor calificados del país, nuestra empresa ha desarrollado las siguientes acciones:</p>\r\n<ul>\r\n<li><strong>Ofrecimiento de salarios justos</strong> a partir de estudios comparativos de remuneraciones en empresas mineras y otras similares.</li>\r\n<li><strong>Posibilidad de hacer carrera</strong>, reconociendo los buenos desempeños de sus trabajadores, los cuales se miden con parámetros objetivos.</li>\r\n<li><strong>Ejecución de programas de inducción laboral</strong> para aprendices, memoristas, estudiantes en práctica e ingenieros en entrenamiento, como forma eficiente de reclutar a talentos jóvenes.</li>\r\n<li><strong>Creación del Centro de Evaluación de Potencial</strong>, el que permite evaluar candidatos para ocupar puestos de trabajo y diseñar planes individuales de capacitación.</li>\r\n<li><strong>Implementación de auditorías internas para detectar talentos</strong> e identificar los motivos por los cuales se producen algunas asimetrías en los desempeños laborales, con el fin de disminuirlas.</li>\r\n<li><strong>Generación de programas de capacitación y talleres</strong> en gestión y desarrollo organizacional.</li>\r\n<li><strong>Programas de capacitación para supervisores</strong>, como el Programa de Desarrollo Gerencial, y talleres de liderazgo y comunicaciones.</li>\r\n<li><strong>Programa de desarrollo por competencias</strong>, orientado a crear planes individuales de capacitación con el fin de cerrar brechas en los desempeños y cumplir con las aspiraciones laborales de nuestros trabajadores.</li>\r\n</ul>\r\n<h2>Encuesta a trabajadores</h2>\r\n<p>Nuestra empresa realiza cada dos años una encuesta de clima laboral, con la cual se determinan las mejores acciones para promover una convivencia armónica y gratificante en cada lugar de trabajo. Entre las acciones desarrolladas destacan:</p>\r\n<ul>\r\n<li><strong>Política de Reconocimientos y Recompensas</strong>, la cual entrega una base común y objetiva con la cual medir desempeños.</li>\r\n<li><strong>Plan de Mejora de Comunicaciones</strong>, que dispone de canales de información apropiados para todos los trabajadores, con el fin de recoger sus inquietudes, y aclarar objetivos y metas.</li>\r\n<li><strong>Línea Abierta</strong>, consistente en una línea de teléfono confidencial creada para canalizar las inquietudes de los trabajadores, contratistas y proveedores, y denunciar posibles prácticas indebidas.</li>\r\n<li><strong>Suscripción de un acuerdo con la Dirección del Trabajo</strong>, para salvaguardar los derechos laborales de los trabajadores contratistas.</li>\r\n<li><strong>Desarrollo de un Sistema de Verificación</strong>, orientado a dar cumplimiento efectivo de los derechos laborales de todos los trabajadores.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '', NULL, NULL, '[]', '', '2013-12-04 22:34:04', 486, '', 0, '0000-00-00 00:00:00', '2013-12-04 22:36:35', 486, '2013-12-04 22:34:04', '0000-00-00 00:00:00', 0, 1, 6, 0, 0, '', '', '', '', 0, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAudioHeight":"","itemVideoAutoPlay":"","itemVideoCaption":"","itemVideoCredits":"","itemImageGallery":"","itemNavigation":"","itemComments":"","itemTwitterButton":"","itemFacebookButton":"","itemGooglePlusOneButton":"","itemAuthorBlock":"","itemAuthorImage":"","itemAuthorDescription":"","itemAuthorURL":"","itemAuthorEmail":"","itemAuthorLatest":"","itemAuthorLatestLimit":"","itemRelated":"","itemRelatedLimit":"","itemRelatedTitle":"","itemRelatedCategory":"","itemRelatedImageSize":"","itemRelatedIntrotext":"","itemRelatedFulltext":"","itemRelatedAuthor":"","itemRelatedMedia":"","itemRelatedImageGallery":"","itemK2Plugins":""}', '', 'robots=\nauthor=', '', '', '*');
